import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";

const App = () => {
  return (
    <React.Fragment>
      <Header />
      <div className="app">
        <h1>Welcome to ProShop</h1>
      </div>
      <Footer />
    </React.Fragment>
  );
};

export default App;
